export const all = state => state.reducer1
export const count = state => all(state).count

export function getCheckBoxState(checkbox_id, checkbox_state) {
    return (state) =>
        state.reducer1.checkboxes[checkbox_id] ||
        checkbox_state ||
        false;
}
